// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract SmartRegister {
    address public owner;
    uint256 private currentWorkId;

    struct Work {
        uint256 id;
        address owner;
        string title;
        string description;
        string fileHash;
        string localPath;
        uint256 timestamp;
        bool isRegistered;
        bool isPublic;  // New field for privacy control
    }

    mapping(uint256 => Work) private works;
    mapping(string => uint256) private hashToId;  // Changed to store ID instead of bool
    mapping(address => uint256[]) private ownerToWorks;  // Optimization for getWorksByOwner

    event WorkRegistered(
        uint256 indexed id,
        address indexed owner,
        string title,
        string fileHash,
        uint256 timestamp
    );

    event WorkTransferred(
        uint256 indexed id,
        address indexed previousOwner,
        address indexed newOwner,
        uint256 timestamp
    );

    event PrivacyUpdated(
        uint256 indexed id,
        bool isPublic
    );

    constructor() {
        owner = msg.sender;
        currentWorkId = 0;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier workExists(uint256 workId) {
        require(works[workId].isRegistered, "Work does not exist");
        _;
    }

    modifier onlyWorkOwner(uint256 workId) {
        require(works[workId].owner == msg.sender, "Only work owner can perform this action");
        _;
    }

    function registerWork(
        string memory title,
        string memory description,
        string memory fileHash,
        string memory localPath,
        bool isPublic
    ) public returns (uint256) {
        require(bytes(title).length > 0, "Title cannot be empty");
        require(bytes(fileHash).length > 0, "File hash cannot be empty");
        require(hashToId[fileHash] == 0, "Work with this hash already exists");

        currentWorkId++;

        works[currentWorkId] = Work({
            id: currentWorkId,
            owner: msg.sender,
            title: title,
            description: description,
            fileHash: fileHash,
            localPath: localPath,
            timestamp: block.timestamp,
            isRegistered: true,
            isPublic: isPublic
        });

        hashToId[fileHash] = currentWorkId;
        ownerToWorks[msg.sender].push(currentWorkId);

        emit WorkRegistered(currentWorkId, msg.sender, title, fileHash, block.timestamp);

        return currentWorkId;
    }

    function getWork(uint256 workId) public view workExists(workId) returns (
        uint256 id,
        address workOwner,
        string memory title,
        string memory description,
        string memory fileHash,
        uint256 timestamp,
        bool isRegistered,
        bool isPublic
    ) {
        Work memory work = works[workId];
        require(work.isPublic || work.owner == msg.sender, "Work is private");

        return (
            work.id,
            work.owner,
            work.title,
            work.description,
            work.fileHash,
            work.timestamp,
            work.isRegistered,
            work.isPublic
        );
    }

    function getWorksByOwner(address workOwner) public view returns (uint256[] memory) {
        return ownerToWorks[workOwner];
    }

    function getWorkByHash(string memory fileHash) public view returns (
        uint256 id,
        address workOwner,
        string memory title,
        string memory description,
        string memory fileHash_,
        uint256 timestamp,
        bool isRegistered,
        bool isPublic
    ) {
        uint256 workId = hashToId[fileHash];
        require(workId > 0, "Work not found");
        return getWork(workId);
    }

    function transferOwnership(uint256 workId, address newOwner) public 
        workExists(workId) 
        onlyWorkOwner(workId) 
    {
        require(newOwner != address(0), "Invalid new owner address");

        address previousOwner = works[workId].owner;
        works[workId].owner = newOwner;

        // Update ownerToWorks mappings
        removeFromOwnerWorks(previousOwner, workId);
        ownerToWorks[newOwner].push(workId);

        emit WorkTransferred(workId, previousOwner, newOwner, block.timestamp);
    }

    function updatePrivacy(uint256 workId, bool isPublic) public 
        workExists(workId) 
        onlyWorkOwner(workId) 
    {
        works[workId].isPublic = isPublic;
        emit PrivacyUpdated(workId, isPublic);
    }

    function removeFromOwnerWorks(address owner_, uint256 workId) private {
        uint256[] storage ownerWorks = ownerToWorks[owner_];
        for (uint256 i = 0; i < ownerWorks.length; i++) {
            if (ownerWorks[i] == workId) {
                if (i != ownerWorks.length - 1) {
                    ownerWorks[i] = ownerWorks[ownerWorks.length - 1];
                }
                ownerWorks.pop();
                break;
            }
        }
    }
}

